// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./interfaces/IMasterChef.sol";
import "./interfaces/IGolToken.sol";
import "./interfaces/INonFungiblePlayer.sol";
import "./interfaces/IGolGameToken.sol";

contract Match is Ownable {
    INonFungiblePlayer private nonFungiblePlayer;
    IGolToken private golToken;
    IGolGameToken private golGameToken;
    address private masterChef;

    mapping(uint256 => uint256) public prizeList;
    address private genesis;

    mapping(address => mapping(uint256 => uint256)) public lastMatchBlock;
    event endMatch(bool success, uint256 indexed tokenPrize);

    constructor(
        IGolToken _golToken,
        INonFungiblePlayer _nonFungiblePlayer,
        IGolGameToken _golGameToken,
        address _genesis,
        address _masterChef
    ) {
        golToken = _golToken;
        nonFungiblePlayer = _nonFungiblePlayer;
        masterChef = _masterChef;
        golGameToken = _golGameToken;
        genesis = _genesis;
    }

    function _rand(uint256 _modulus) internal view returns (uint256) {
        return
            uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender))) %
            _modulus;
    }

    function setPrizeList(uint256[] calldata _prizeList) public onlyOwner {
        require(
            _prizeList.length == 50,
            "The prize list must be for the Each Level"
        );

        for (uint8 i = 0; i < _prizeList.length; i++) {
            prizeList[i] = _prizeList[i];
        }
    }

    function initialDeposit(uint256 _amount) public onlyOwner {
        require(
            golGameToken.balanceOf(address(this)) > _amount * 10**18,
            "Insufficient balance!"
        );

        golGameToken.approve(masterChef, _amount * 10**18);
        IMasterChef(masterChef).deposit(2, _amount);
    }

    function depositGameToken() public {
        IMasterChef(masterChef).deposit(2, 0);
    }

    function emergencyWithdrawFromPool() public {
        IMasterChef(masterChef).emergencyWithdraw(2);
    }

    function startMatch(uint256[] memory _tokenIds) public {
        require(
            msg.sender == nonFungiblePlayer.ownerOf(_tokenIds[0]) &&
                msg.sender == nonFungiblePlayer.ownerOf(_tokenIds[1]) &&
                msg.sender == nonFungiblePlayer.ownerOf(_tokenIds[2]) &&
                msg.sender == nonFungiblePlayer.ownerOf(_tokenIds[3]),
            "You are not owner of these Players!"
        );

        require(
            nonFungiblePlayer.getLevel(_tokenIds[0]) ==
                nonFungiblePlayer.getLevel(_tokenIds[1]) &&
                nonFungiblePlayer.getLevel(_tokenIds[1]) ==
                nonFungiblePlayer.getLevel(_tokenIds[2]) &&
                nonFungiblePlayer.getLevel(_tokenIds[2]) ==
                nonFungiblePlayer.getLevel(_tokenIds[3]),
            "Players' level must be same!"
        );

        string memory position0 = nonFungiblePlayer.getPosition(_tokenIds[0]);
        string memory position1 = nonFungiblePlayer.getPosition(_tokenIds[1]);
        string memory position2 = nonFungiblePlayer.getPosition(_tokenIds[2]);
        string memory position3 = nonFungiblePlayer.getPosition(_tokenIds[3]);

        require(
            keccak256(abi.encodePacked(position0)) !=
                keccak256(abi.encodePacked(position1)) &&
                keccak256(abi.encodePacked(position0)) !=
                keccak256(abi.encodePacked(position2)) &&
                keccak256(abi.encodePacked(position0)) !=
                keccak256(abi.encodePacked(position3)) &&
                keccak256(abi.encodePacked(position1)) !=
                keccak256(abi.encodePacked(position2)) &&
                keccak256(abi.encodePacked(position1)) !=
                keccak256(abi.encodePacked(position3)) &&
                keccak256(abi.encodePacked(position2)) !=
                keccak256(abi.encodePacked(position3)),
            "Position of each player must be different!"
        );

        uint256 gen = nonFungiblePlayer.getGeneration(_tokenIds[0]);

        require(
            (block.number - lastMatchBlock[msg.sender][gen]) >=
                (28800 / (gen + 1)),
            "Locked for Match per this generation!"
        );

        uint256 genesisHolderBooster = IERC721(genesis).balanceOf(msg.sender) >
            0
            ? 125
            : 100;
        uint256 golTokenBalance = golToken.balanceOf(msg.sender);
        uint256 golHolderBooster = golTokenBalance >= 50000 * 10**18
            ? 15
            : golTokenBalance >= 40000 * 10**18
            ? 14
            : golTokenBalance >= 30000 * 10**18
            ? 13
            : golTokenBalance >= 20000 * 10**18
            ? 12
            : golTokenBalance >= 10000 * 10**18
            ? 11
            : 10;
        uint256 totalGolPower = 0;
        for (uint8 i = 0; i < 4; i++) {
            string memory rarity = nonFungiblePlayer.getRarity(_tokenIds[i]);
            uint256 sp = nonFungiblePlayer.getSkillPoint(_tokenIds[i]);
            if (sp == 0) sp++;
            totalGolPower +=
                sp *
                (
                    keccak256(abi.encodePacked(rarity)) ==
                        keccak256(abi.encodePacked("Mythical"))
                        ? 14
                        : keccak256(abi.encodePacked(rarity)) ==
                            keccak256(abi.encodePacked("Legendary"))
                        ? 13
                        : keccak256(abi.encodePacked(rarity)) ==
                            keccak256(abi.encodePacked("Rare"))
                        ? 12
                        : keccak256(abi.encodePacked(rarity)) ==
                            keccak256(abi.encodePacked("Uncommon"))
                        ? 11
                        : 10
                );
        }

        totalGolPower = totalGolPower * genesisHolderBooster * golHolderBooster;

        uint256 leagueDifficulty = (((nonFungiblePlayer.getLevel(_tokenIds[0]) +
            1) *
            10 -
            1) *
            4 *
            14 *
            125 *
            15 *
            95);

        if (
            _rand(10000) <=
            (totalGolPower * 10000) / leagueDifficulty / 100000000
        ) {
            uint256 prize = prizeList[nonFungiblePlayer.getLevel(_tokenIds[0])];

            while (golToken.balanceOf(address(this)) < prize * 10**13)
                IMasterChef(masterChef).deposit(2, 0);

            golToken.transfer(msg.sender, prize * 10**13);
            emit endMatch(true, prize);
        } else emit endMatch(false, 0);

        lastMatchBlock[msg.sender][gen] = block.number;
    }

    function getWinningChance(uint256[] memory _tokenIds, address _owner)
        public
        view
        returns (uint256)
    {
        require(
            nonFungiblePlayer.getLevel(_tokenIds[0]) ==
                nonFungiblePlayer.getLevel(_tokenIds[1]) &&
                nonFungiblePlayer.getLevel(_tokenIds[1]) ==
                nonFungiblePlayer.getLevel(_tokenIds[2]) &&
                nonFungiblePlayer.getLevel(_tokenIds[2]) ==
                nonFungiblePlayer.getLevel(_tokenIds[3]),
            "Players' level must be same!"
        );

        string memory position0 = nonFungiblePlayer.getPosition(_tokenIds[0]);
        string memory position1 = nonFungiblePlayer.getPosition(_tokenIds[1]);
        string memory position2 = nonFungiblePlayer.getPosition(_tokenIds[2]);
        string memory position3 = nonFungiblePlayer.getPosition(_tokenIds[3]);

        require(
            keccak256(abi.encodePacked(position0)) !=
                keccak256(abi.encodePacked(position1)) &&
                keccak256(abi.encodePacked(position0)) !=
                keccak256(abi.encodePacked(position2)) &&
                keccak256(abi.encodePacked(position0)) !=
                keccak256(abi.encodePacked(position3)) &&
                keccak256(abi.encodePacked(position1)) !=
                keccak256(abi.encodePacked(position2)) &&
                keccak256(abi.encodePacked(position1)) !=
                keccak256(abi.encodePacked(position3)) &&
                keccak256(abi.encodePacked(position2)) !=
                keccak256(abi.encodePacked(position3)),
            "Position of each player must be different!"
        );

        uint256 genesisHolderBooster = IERC721(genesis).balanceOf(_owner) > 0
            ? 125
            : 100;
        uint256 golTokenBalance = golToken.balanceOf(_owner);
        uint256 golHolderBooster = golTokenBalance >= 50000 * 10**18
            ? 15
            : golTokenBalance >= 40000 * 10**18
            ? 14
            : golTokenBalance >= 30000 * 10**18
            ? 13
            : golTokenBalance >= 20000 * 10**18
            ? 12
            : golTokenBalance >= 10000 * 10**18
            ? 11
            : 10;
        uint256 totalGolPower = 0;
        for (uint8 i = 0; i < 4; i++) {
            string memory rarity = nonFungiblePlayer.getRarity(_tokenIds[i]);
            uint256 sp = nonFungiblePlayer.getSkillPoint(_tokenIds[i]);
            if (sp == 0) sp++;
            totalGolPower +=
                sp *
                (
                    keccak256(abi.encodePacked(rarity)) ==
                        keccak256(abi.encodePacked("Mythical"))
                        ? 14
                        : keccak256(abi.encodePacked(rarity)) ==
                            keccak256(abi.encodePacked("Legendary"))
                        ? 13
                        : keccak256(abi.encodePacked(rarity)) ==
                            keccak256(abi.encodePacked("Rare"))
                        ? 12
                        : keccak256(abi.encodePacked(rarity)) ==
                            keccak256(abi.encodePacked("Uncommon"))
                        ? 11
                        : 10
                );
        }

        totalGolPower = totalGolPower * genesisHolderBooster * golHolderBooster;

        uint256 leagueDifficulty = (((nonFungiblePlayer.getLevel(_tokenIds[0]) +
            1) *
            10 -
            1) *
            4 *
            14 *
            125 *
            15 *
            95);

        return (totalGolPower * 10000) / leagueDifficulty / 100000000;
    }

    function getWinningPrize(uint256 level) public view returns (uint256) {
        return prizeList[level];
    }

    function isLockedForLevel(uint256 gen, address _owner)
        public
        view
        returns (bool)
    {
        return
            (block.number - lastMatchBlock[_owner][gen]) >= (28800 / (gen + 1));
    }
